import React from 'react'
import Grid from '@material-ui/core/Grid';

const Exercise = () => {
	return (
		<div>
			<Grid container>
				<Grid item sm>
					Left Pane
				</Grid>
				<Grid item sm>
					Right Pane
				</Grid>
			</Grid>
		</div>
		)
} 

export default Exercise;
